import React, { useState } from 'react'
import img from "./pics/sk1.jpg"
import Pordcar from './Pordcar'

const Portfolio = () => {
    // const [pCard, setPCard] = useState()
    {
        Pordcar.map((crnVal)=>{
            return(
                <>
                <a href="/">
                    <div className="port_item">
                        <div className="port_heading">{crnVal.AFreelancer}</div>
                        <img src={img} alt="" />
                    </div>
                </a>
                </>
            )
        })

    }
    return (
        <>
        <div className="portfolio">
           <Pordcar/>
                  
            </div>
        </>
    )
}

export default Portfolio
